import React from "react";
import ProductItem from "./ProductItem";

// create Product component which contains the list of ProductItem component
const ProductList = ({pro}) => {
  return <div data-testid="products-container">{pro.map((ele) => {
    return(
      <ProductItem
      key={ele.id} avatar={ele.image} price={ele.price} title={ele.title} category={ele.category}/>
    )
  })}</div>;
};

// export
export default ProductList;
